A basic block is a container for a list of instructions, all of which are executed in the order they appear in a given block. This effectively makes basic blocks a small-scale linear IR, since a given basic block contains exclusively IR that is executed linearly without branching. ; implements the quadratic formula, given f64 %a, f64 %b and f64 %c
block: %0 = fneg f64 %b ; -b %1 = fconst f64 2.0 %2 = call f64 @pow(f64 %b, f64 %1) ; b^2 %3 = fmul f64 %a, %c ; ac %4 = fconst f64 4.0 %5 = fmul f64 %3, %4 ; 4ac %6 = fsub f64 %2, %5 ; b^2 - 4ac %7 = call f64 @sqrt(f64 %6) ; sqrt(b^2 - 4ac) %8 = fmul f64 %a, %1 ; 2a %9 = fadd f64 %0, %7 ; -b + sqrt(b^2 - 4ac) %x1 = fdiv f64 %10, %1 ; (-b + sqrt(b^2 - 4ac)) / 2.0 %10 = fsub f64 %0, %7 ; -b - sqrt(b^2 - 4ac) %x2 = fdiv f64 %10, %1 ; (-b - sqrt(b^2 - 4ac)) / 2.0 ; x1 = + solution ; x2 = - solution Basic blocks have exactly one terminator , these are the last instruction in a given basic block. They are some sort of branching-ish instruction that moves control somewhere else. Basic block can also contain one or more parameters , these implement the φ (phi) function found in SSA-based IRs. When jumping to a block with a parameter, different control flow paths can pass different values for the parameter, effectively implementing phis while automatically enforcing the ideal phi properties just through the structure of the IR. Note: This avoids the usual special-casing of instructions in transform passes, LLVM has to treat phi as magic and move it around differently than anything else, but it's still an instruction. This also lends well to "magic" instructions, so things like landingpad and invoke would be representable in a normal way instead of adding magical rules like LLVM had to. Consider the following IR: entry: condbr bool %0, one, two one: %1 = iconst i32 16 br merge(%1) two: %2 = iconst i32 24 br merge(%2) merge(i32 %3): ret i32 %3 It correctly implements the following C code: int x; if (%0) x = 16;
else x = 24; return x;

