'call‘ - Call Function Calls a function, passing zero or more arguments to that function and eventually returning when the called function returns. decl i32 @add(i32, i32) decl void @do_something() func i32 @something_else() {
%entry: %0 = call i32 @add(i32 0, i32 1) call void @do_something() ret i32 %0
} Calls to void functions cannot be bound to a name, as they do not really have a 'value’. Syntax: (<val> =)? call <ty> <fn-name>((<ty> <val>)*)

