‘br’ - Unconditional Branch Unconditionally moves execution to another basic block. br next This is effectively the goto construct. Syntax: br <label> ‘condbr’ - Conditional Branch Conditionally chooses one of two branches to move execution to, depending on a bool condition. ; equivalent to the following C code:
; ; if (%0) ; goto %if.true;
; else ; goto %if.false;
; %0 = iconst i32 0
%1 = icmp eq i32 %x, %0
condbr bool %1, if.true, if.false condbr is only able to branch based on bool values. The first branch is always taken for a true value, and the second is always taken for a false value. Syntax: condbr <ty> <val>, <label>, <label> ‘unreachable‘ - Unreachable instruction Similar to __builtin_unreachable: Effectively asserts that the containing block cannot be reached in a valid program. If the containing block is reached (and therefore the unreachable is executed), the program's behavior is undefined. unreachable This can be used for aggressive optimizations, as blocks that have unreachable as their terminator can be optimized into an empty block (except for unreachable), and any branches that go to an unreachable block can be assumed to be never taken. This can lead to some extremely aggressive transformations. unreachable is effectively "viral,” one block containing it can "infect" many blocks that go to it (directly or not). When optimizations are enabled, branches that are determined to be unreachable may be removed, or may remain as blocks that simply contain unreachable. When the actual compilation step is performed, unreachable may be transformed into a trap instruction, or the block may simply be removed if it was unable to be removed during optimization. ‘ret‘ - Return Returns from a function to a given caller. ret i32 64 ret can return either void (in which case nothing is returned), or a value of a given type. Syntax: ret ((void) | (<ty> <val>))

