'alloca‘ - Allocate in Stack Frame Allocates memory in the current function’s stack frame. The memory is always automatically returned when the function in which the memory was allocated returns to its caller. This is effectively the alloca function in C. %0 = alloca [i64, 512] Syntax: <val> = alloca <ty> ‘load’ - Load Value from Address Loads a value of a given type from a given address. ; equivalent C code:
;
; int32_t x = *((int32_t*)p);
; %x = load i32, ptr %p Syntax: <result> = load (volatile)? <ty>, <ty> <val> Given load T, ptr %p, the pointer %p must be valid and point to an allocation of least sizeof(T) bytes. It is undefined behavior to store to a misaligned pointer, or to a pointer that points outside the bounds of objects allocated by the program. A load can be marked as volatile, which signals that the load must not be moved relative to any other volatile loads or stores (or any operations that could potentially execute volatile loads or stores, e.g. calling an optimizer-opaque function). It also signals that the load cannot be omitted under any circumstances. ‘store’ - Store Value to Address Stores a value of a given type to a given address. ; equivalent C code:
; ; *((int32_t*)p) = x;
; store i32 %x, ptr %p Syntax: store (volatile)? <ty> <val>, <ty> <val> Given store T %t, ptr %p, the pointer %p must be valid and point to at least sizeof(T) bytes. It is undefined behavior to store to a misaligned pointer, or to a pointer that points outside the bounds of objects allocated by the program. A store can be marked as volatile, which signals that the store must not be moved relative to any other volatile loads or stores. It also signals that the store cannot be omitted under any circumstances. Example: %0 = call ptr @malloc(i64 4)
store i32 %x, ptr %0 ‘offset’ - Calculate Pointer Offset Performs C-like pointer arithmetic. ; equivalent C code: ; ; void* new = ((int32_t*)p) + offset; ; %new = offset i32, ptr %p, i64 %offset There are no restrictions on what pointer values may be computed, but keep in mind that the resulting pointer may point outside the bounds of allocated objects may be misaligned, etc. Loading or storing to such addresses is undefined, but this is irrelevant to offset. The second operand must be an integer. If the integer is smaller than the native pointer size, sign-extending occurs. If the integer is larger, truncation is performed.

